const e=JSON.parse('{"key":"v-f00eb258","path":"/note/golang/golang-daily-lib/cobra.html","title":"cobra","lang":"zh-CN","frontmatter":{"title":"cobra","date":"2021-10-21T00:00:00.000Z","category":["golang"],"tag":["golang daily lib"],"timeline":true},"headers":[{"level":2,"title":"简介","slug":"简介","link":"#简介","children":[]},{"level":2,"title":"快速开始 quick start","slug":"快速开始-quick-start","link":"#快速开始-quick-start","children":[]},{"level":2,"title":"特性 Feature","slug":"特性-feature","link":"#特性-feature","children":[]},{"level":2,"title":"命令 Command","slug":"命令-command","link":"#命令-command","children":[]},{"level":2,"title":"选项 Flag","slug":"选项-flag","link":"#选项-flag","children":[{"level":3,"title":"简单计算器","slug":"简单计算器","link":"#简单计算器","children":[]}]},{"level":2,"title":"脚手架 Scaffold","slug":"脚手架-scaffold","link":"#脚手架-scaffold","children":[]},{"level":2,"title":"其他","slug":"其他","link":"#其他","children":[]},{"level":2,"title":"参考","slug":"参考","link":"#参考","children":[]}],"git":{"updatedTime":1682668422000},"readingTime":{"minutes":8.2,"words":2459},"filePathRelative":"note/golang/golang-daily-lib/cobra.md","localizedDate":"2021年10月21日","excerpt":"<h2> 简介</h2>\\n<p>cobra是一个命令行程序库，可以用来编写命令行程序。同时也提供了一个脚手架，用于生成基于cobra的应用程序框架。非常多知名的开源项目使用了cobra库构建命令行，如Kubernetes,hugo,etcd等。</p>\\n<p>关于作者<a href=\\"http://github.com/spf13\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">spf13</a>，这里多说两句。spf13 开源不少项目，而且他的开源项目质量都比较高。 相信使用过 vim 的都知道<a href=\\"https://github.com/spf13/spf13-vim\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">spf13-vim</a>，号称 vim 终极配置。 可以一键配置，对于我这样的懒人来说绝对是福音。他的<a href=\\"https://github.com/spf13/viper\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">viper</a>是一个完整的配置解决方案。 完美支持 JSON/TOML/YAML/HCL/envfile/Java properties 配置文件等格式，还有一些比较实用的特性，如配置热更新、多查找目录、配置保存等。 还有非常火的静态网站生成器<a href=\\"https://gohugo.io/\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">hugo</a>也是他的作品。</p>"}');export{e as data};
